import React, { Fragment } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
    const name = '리액트';
    return (
        <div>
            {name === '리액트' ? (
                <h1>{name} 안녕!</h1>
            ) : (
                    <h2>잘 작동하니?</h2>
                )}
        </div>
    );
}

export default App;
